import React,{Component} from 'react';
import "../assets/css/reg.scss"


export default class Reg extends Component{
    state={
        username:"",
        password:"",
        msg:""
    }


    render(){
        return(
            <div className="reg">
                <div className="user">
                    账号
                    <input type="text" />
                </div>
                <div className="password">
                    密码
                    <input type="password"/>
                </div>
                <div className="btn">
                    <input type="button" value="提交"/>
                    <a href="#">忘记密码</a>
                </div>

            </div>
        )
    }

}
